import React, {memo, useCallback, useState} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

import * as colors from '../style/colors';

const HeaderContainer = styled.div`
    position: sticky;
    top:40px;
    left:0;
    background-color: #065;
    width:100%;
    height:90px;
    z-index: 99999999;
    display: flex;
    align-items: center;
    padding: 0 100px;

    &:hover{
      .logoImg{
        filter:brightness(0)  invert(17%) sepia(61%) saturate(5015%) hue-rotate(348deg) brightness(82%) contrast(93%);
      }
    }
    

    &:hover{
      background-color: #ffffff;

      .mainMenuWrap{
        .mainMenuItem{
          .link{
            color:#000;
          }
        }
      }
    }

    .mainMenuWrap{

      display: flex;
      margin-left:50px;


      .mainMenuItem{

        &:hover{
            .subMenuWrap{
            }
          }


        .link{
          font-size:16px;
          font-weight: 600;
          color:#fff;
          margin-right:40px;

        }

        .subMenuWrap{
          box-sizing: border-box;
          position: absolute;
          width:100%;
          top:90px;
          left:0;
          background-color: #fff;
          z-index:999999999999;
          display: flex;
          flex-direction: column;
          overflow: hidden;
          max-height:0;
          transition: max-height 180ms ease-out;

          .subMenuInner{
            padding:50px 280px 100px 280px;
            display: flex;

            .common{
              width:200px;

              .subMenuItem{
                margin-right:130px;
                margin-bottom:14px;
                
              }
              a{
                font-size:14px;
              }
            }

            .each{
              border-left:1px solid #eeeeee;
              height:max-content;
              width:200px;

              .subMenuItem{
                padding-left:40px;
                margin-bottom:14px;

              }
              a{
                font-size:14px;
                color:#a1a1a1;
              }
            }

            .eachImg{
              margin-left:280px;
              height: auto;

              img{
                width:200px;
                height:auto;
                margin-left:20px;
              }
            }
          }
        }
      }
    }
`;

const Header = memo(() => {

  const { header } = dataset;
  // const [navItem, setNavItem] = useState('');

  // const onNavItemOver = useCallback((e) =>{
  //   const element = e.currentTarget;
  //   const index = Array.from(element.parentNode.children).indexOf(element);
  //   console.log(element, index);


  //   setNavItem(navItem);
  // }, [navItem]);

  const onMenuItemOver = useCallback((e) =>{
    e.preventDefault();
    const current = e.currentTarget;
    // const sub = current.querySelector('.subMenuWrap');
    // scrollHeight는 요소의 크기를 벗어난 만큼의 높이를 의미

    console.log(current);
    const sub = current.querySelector('.subMenuWrap');
    console.log(sub);
    sub.style.maxHeight = sub.scrollHeight + 'px';
  }, []);

  const onMenuItemOut = useCallback((e) =>{
    e.preventDefault();
    const current = e.currentTarget;
    const sub = current.querySelector('.subMenuWrap');
    sub.style.maxHeight = '0px';
  }, []);

  // {header.map((v, i) =>{
  //   console.log(v.id);
  //   if(v.id === "03"){
  //     return(
  //       v.leftchildren.map((j, k) =>{
  //         return(
  //           <li key={k}>
  //             {console.log(j)}
  //             <a href={j.url}>{j.title}</a>
  //           </li>
  //         );
  //       })
  //     )
  //   }
  // })}

  return (
    <HeaderContainer>
        <a href='#'><img className='logoImg' alt='logoImg' src='img/logo.png'/></a>
        <ul className='mainMenuWrap'>
          <li className='mainMenuItem'>
            {header.map((v, i) =>{
              return(
